import React, { useState, useEffect } from 'react';
import Headermenu from "./Headermenu";
import Headertop from "./Headertop";
import Pagefooter from "./Pagefooter";
import Pagefooterinfo from "./Pagefooterinfo";
import axios from "axios";

function MusteriList() {

  const [customer, setCustomerList] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await axios.get(
          "https://private-d90551-merteribol.apiary-mock.com/customerlist"
        );
        setCustomerList(response.data.CustomerList); // Burada setCustomerList kullanmalısınız
      } catch (error) {
        console.error("Müşteri verileri alınamadı:", error);
      }
    };

    fetchData();
  }, []);

  console.log(customer);

  return (
    <div>
      {/* BEGIN HEADER */}
      <div className="page-header">
        {/* BEGIN HEADER TOP */}
        <Headertop />
        {/* END HEADER TOP */}
        {/* BEGIN HEADER MENU */}
        <div className="page-header-menu">
          <div className="container">
            <div className="hor-menu ">
              <Headermenu />
            </div>
          </div>
        </div>
      </div>
      {/* END HEADER */}

      {/* BEGIN PAGE CONTAINER */}
      <div className="page-container">
        {/* BEGIN PAGE HEAD */}
        <div className="page-head">
          <div className="container">
            <div className="page-toolbar">
              <div className="btn-group btn-theme-panel">
                <a href="javascript:;" className="btn dropdown-toggle" data-toggle="dropdown">
                  <i className="icon-settings" />
                </a>
                {/* Theme settings omitted for brevity */}
              </div>
            </div>
          </div>
        </div>
        {/* END PAGE HEAD */}

        {/* BEGIN PAGE CONTENT */}
        <div className="page-content">
          <div className="container">
            <ul className="page-breadcrumb breadcrumb">
              <li>
                <a href="#">Ana Sayfa</a><i className="fa fa-circle" />
              </li>
              <li>
                <a href="form_controls.html">Müşteri Yönetimi</a>
                <i className="fa fa-circle" />
              </li>
              <li className="active">
                Müşteri Listesi
              </li>
            </ul>

            <div className="row">
              <div className="col-md-12">
                {/* BEGIN SAMPLE TABLE PORTLET */}
                <div className="portlet light">
                  <div className="portlet-title">
                    <div className="caption">
                      <span className="caption-subject font-green-sharp bold">Müşteri Listesi</span>
                    </div>
                    <div className="tools">
                      <a href="javascript:;" className="collapse"></a>
                    </div>
                  </div>

                  <div className="portlet-body flip-scroll">
                    <table className="table table-bordered table-striped table-condensed flip-content">
                      <thead className="flip-content">
                        <tr>
                          <th width="20%">Ad</th>
                          <th>Soyad</th>
                          <th>Mail Adresi</th>
                          <th>GSM</th>
                          <th>Adres</th>
                          <th>Şehir</th>
                        </tr>
                      </thead>
                      <tbody>
                        {customer.map((customer, index) => (
                          <tr key={index}>
                            <td>{customer.ad}</td>
                            <td>{customer.soyad}</td>
                            <td>{customer.mail_adresi}</td>
                            <td>{customer.gsm}</td>
                            <td>{customer.adres}</td>
                            <td>{customer.sehir}</td>
                          </tr>
                        ))}
                      </tbody>
                    </table>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
        {/* END PAGE CONTENT */}
      </div>
      {/* END PAGE CONTAINER */}

      {/* BEGIN PRE-FOOTER */}
      <Pagefooter />
      {/* END PRE-FOOTER */}

      {/* BEGIN FOOTER */}
      <Pagefooterinfo />
      <div className="scroll-to-top">
        <i className="icon-arrow-up" />
      </div>
    </div>
  );
}

export default MusteriList;
